import style from './Header.module.css';
const Header = () => {

    return (
        <header>
        <h1 className = {style ['logo']}>Hschool</h1> 
        <div сlassName = {style ['header-buttons']}></div>
        <p className = {style ['nightmode']}></p>  
        <p className = {style ['contact']}></p> 
        <p className = {style ['language']}></p> 
        <p className = {style ['signup']}></p> 
        </header>
    );
};

export default Header;
